descripcion:
unica esquina disponible 
cuenta en la planta baja con: 
lindo jardín delantero; 
amiento hasta para 8 autos; 
recibidor, estudio, sala-comedor; 
amplio closet de blancos; 
medio baño: 1 
cocina 
cuarto de servicio con baño; 
patio de servicio techado; 
hermoso jardin trasero. 
en planta alta cuenta con: 
2 recamaras con closet grandes, comparten un baño completo; 
amplio cuarto de tv; 
terraza techada en zona de tv; 
recamara principal hermosa y enorme, con balcón y vestidor para dos personas; 
baño completo preparado para instalar jacuzzi; 
adaptaciones adicionales: 
sistema de riego con aspersores en jardín delantero y trasero; 
el fraccionamiento cuenta con palapa, salón de usos múltiples con capacidad para 100 personas, áreas de juego, cancha de fútbol con césped artificial y portones eléctricos. 
conózcala y se convencerá 
